import React, { useState } from "react";
import UniversityData from "./UniversityData";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState("");
  const [studentType, setStudentType] = useState("International");
  const [selectedSubject, setSelectedSubject] = useState(null);

  const handleUniversityChange = (event) => {
    setSelectedUniversity(event.target.value);
    setSelectedSubject(null);
  };

  const handleStudentTypeChange = (event) => {
    setStudentType(event.target.value);
  };

  const handleSubjectClick = (subject) => {
    setSelectedSubject(subject);
  };

  const university = UniversityData.find(
    (u) => u.name === selectedUniversity
  );

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>QS World University Rankings Explorer</h1>

      <div>
        <label>Select University: </label>
        <select onChange={handleUniversityChange} value={selectedUniversity}>
          <option value="">-- Select --</option>
          {UniversityData.map((u) => (
            <option key={u.name} value={u.name}>
              {u.name}
            </option>
          ))}
        </select>
      </div>

      {university && (
        <>
          <h2>General QS Rank: {university.generalQSRank}</h2>

          <div>
            <label>
              <input
                type="radio"
                name="studentType"
                value="International"
                checked={studentType === "International"}
                onChange={handleStudentTypeChange}
              />
              International
            </label>
            <label style={{ marginLeft: "10px" }}>
              <input
                type="radio"
                name="studentType"
                value="Domestic"
                checked={studentType === "Domestic"}
                onChange={handleStudentTypeChange}
              />
              Domestic
            </label>
          </div>

          <h3>Subjects Offered:</h3>
          <ul>
            {university.subjects.map((subject) => (
              <li key={subject.name}>
                <button onClick={() => handleSubjectClick(subject)}>
                  {subject.name}
                </button>
              </li>
            ))}
          </ul>
        </>
      )}

      {selectedSubject && (
        <div style={{ marginTop: "20px" }}>
          <h2>{selectedSubject.name}</h2>
          <p><strong>QS Rankings (last 5 years):</strong> {selectedSubject.qsRankings.join(", ")}</p>
          <p><strong>Course Start Date:</strong> {selectedSubject.startDate}</p>
          <p><strong>Tuition Fees ({studentType}):</strong> {selectedSubject.fees[studentType]}</p>
          <p><strong>Eligibility ({studentType}):</strong> {selectedSubject.eligibility[studentType]}</p>
          <p><strong>GPA Cutoffs (last 5 years):</strong> {selectedSubject.gpaCutoffs.join(", ")}</p>
          <p><strong>SAT Cutoffs (last 5 years):</strong> {selectedSubject.satCutoffs.join(", ")}</p>
          <p><strong>Course Link:</strong> <a href={selectedSubject.courseLink} target="_blank" rel="noopener noreferrer">{selectedSubject.courseLink}</a></p>
        </div>
      )}
    </div>
  );
}

export default App;
